$(function() {

	function toiletSpinner() {
		/**
		 * Global variables
		 */
		var flushAudioSrc, flushPlayer, toilet, flusher;

		/**
		 * Document and flusher handle
		 */
		toilet = $('body'),
		flusher = $('<a id="flusherHandle">Flush me!</a>');

		/**
		 * Flush audio and player
		 */
		flushAudioSrc = "data:audio/mpeg;base64,",
		flushPlayer = $('<audio preload="preload" id="flushSound"></audio>');
		flushPlayer.prepend('<source type="audio/mpeg"/>');
		flushPlayer.find('source').attr( 'src', flushAudioSrc );

		/**
		 * Style the flusher handle
		 */
		flusher.css({
			'color' : 'red',
			'cursor' : 'pointer',
			'font-weight' : 'bold',
			'position' : 'absolute',
			'top' : '20px',
			'right' : '20px'
		});

		/**
		 * Insert the audio and flusher handle
		 * into the DOM
		 */
		toilet.prepend(flushPlayer);
		toilet.prepend(flusher);

		/**
		 * The flusher handle actions
		 */
		flusher.on( 'click', function() {
			$('#flushSound').trigger('play');
			toilet.css({
				'font-size' : '0px',
				'-webkit-transition:' : '2s all ease-in-out',
				'-moz-transition' : '2s all ease-in-out',
				'transition' : '2s all ease-in-out',
				'-webkit-transform': 'rotate(360deg)',
				'-moz-transform' : 'rotate(360deg)',
				'-o-transform' : 'rotate(360deg)',
				'-ms-transform' : 'rotate(360deg)'
			});
		});
	}

	toiletSpinner();

});